import React from "react";
import "./Skills.css";

function Skills() {
  return (
    <div className="Skill component__space" id="Skills">

      <div className="heading">
        <h1 className="heading">My Skills</h1>
      </div>

      <div className="container">
      </div>
    </div>
  );
}

export default Skills;
